import React, { useState } from 'react';
import User from './ pages/User'
import './App.css';

const App: React.FC = () => {

  const [todo, setTodo] = useState([])

  const componentDidMount = () => {
    fetch("http://127.0.0.1:8000/api")
    .then(
      response => console.log(response.json())
    )
  }

  return (
      <div>
        <User />
      </div>
  );
}

export default App;
